import React, { Component } from 'react';

const signUpButton = document.getElementById('signUp');
const signInButton = document.getElementById('signIn');
const container = document.getElementById('container');

signUpButton.addEventListener('click', () => {
	container.classList.add("right-panel-active");
});

signInButton.addEventListener('click', () => {
	container.classList.remove("right-panel-active");
});

const SignupForm = () => {
    return(
        <div className='Form'>
            <h1>Crear cuenta</h1>

            <div class="form-floating mb-3">
                <input type="text" class="form-control" id="floatingName" placeholder="name@example.com"/>
                <label for="floatingName">Nombre</label>
            </div>
            <div class="form-floating mb-3">
                <input type="text" class="form-control" id="floatingLN1" placeholder="name@example.com"/>
                <label for="floatingLN1">Primer Apellido</label>
            </div>
            <div class="form-floating mb-3">
                <input type="text" class="form-control" id="floatingLN2" placeholder="name@example.com"/>
                <label for="floatingLN2">Segundo Apellido</label>
            </div>
            <div class="form-floating mb-3">
                <input type="text" class="form-control" id="floatingemail" placeholder="name@example.com"/>
                <label for="floatingemail">Correo Electronico</label>
            </div>
            <div class="form-floating mb-3">
                <input type="password" class="form-control" id="floatingPassword" placeholder="name@example.com"/>
                <label for="floatingPassword">Contrase√±a</label>
            </div>
            <div>
                <button className='submit'>Registrar</button>
            </div>
        </div>
    );
};

export default SignupForm;
